const axios=require('axios')
var data;
async function fun(){
    try {
        data=await axios.get("/")
        //console.log(data.body)
    } catch (error) {
        console.log("hello")
        console.log(error)
    }
    
        
}
fun();

//data="shubham"
//export default data
